query getAllExhibits {
    ourExhibitsCollection {
      items {
        name
        picture {
          url
        }
      }
    }
  }

query getExhibitByName($name: String!) {
    ourExhibitsCollection(where: { name_contains: $name }) {
      items {
        name
        description
        picture {
          url
        }
      }
    }
  }
